import Header from '../Header/Header';
import './Home.css'
import '../routes.css'

const Home = () => (

    <div className='routes-bg'>
        <Header />
        <div className='home-bg'>
        <h1><span>Claw</span> Enterprises</h1>
        <p>India's first SaaS platform for Generative AI products in Indian Legal Niche. Claw aims to break the chains of old unprofessional Indian legal research by introducing Legal GPT which brings every Indian law just to your fingertips</p>
        </div>  
    </div>
)

export default Home;
